  var mapEl = document.getElementById("kunyi-map");
  var markers = [];
  var markerClusterer;
  var locMakers = {};
  var directionsDisplay;
  var map;

  function Marker(latitude, longitude, type){
    this.latitude = latitude;
    this.longitude = longitude;
    this.type = type;
    this.marker = this.createMarker();
  }

  Marker.prototype.createMarker = function(){
    return new google.maps.Marker({
      position: new google.maps.LatLng(this.latitude, this.longitude),
      icon: window.location.origin + "/img/home_flood_icon.svg"
    });
  };

  Marker.prototype.unsetMap = function() {
    this.marker.setMap(null);
  };

  Marker.prototype.setMap = function(map) {
    this.marker.setMap(map);
  };

  function initialize() {
    var mapOptions = {
      center: { lat: 21.9403599, lng: 96.0758242 },
      zoom: 6
    };
    
    directionsDisplay = new google.maps.DirectionsRenderer();
    map = new google.maps.Map(mapEl , mapOptions);
    directionsDisplay.setMap(map);

    locMakers.kunyi = locations.map(function(loc){
      return new Marker(loc.latitude, loc.longitude, "kunyi");
    });

    locMakers.kokoye = locations2.map(function(loc){
      return new Marker(loc.coordinates[0], loc.coordinates[1], "kokoye");
    });

    markers = locMakers.kunyi.map(function(marker){ return marker.marker});
    markerClusterer = new MarkerClusterer(map, markers, {gridSize: 50, maxZoom: 15});

    $("#kunyi-map-panel").click(function(event){
      markers = locMakers.kunyi.map(function(marker){ return marker.marker});
      if(markerClusterer)
        markerClusterer.clearMarkers();
      markerClusterer = new MarkerClusterer(map, markers, {gridSize: 50, maxZoom: 15});

    });

    $("#kokoye-map-panel").click(function(event){
      markers = locMakers.kokoye.map(function(marker){ return marker.marker});
      if(markerClusterer)
        markerClusterer.clearMarkers();
      markerClusterer = new MarkerClusterer(map, markers, {gridSize: 50, maxZoom: 15});
    });
  }

  google.maps.event.addDomListener(window, 'load', initialize);

